import { createSlice } from '@reduxjs/toolkit'

let testState2 = createSlice({
  name: "testState",
  initialState: 0,
  reducers: {
    increase(state, action) {
      return state + action.payload;
    }
  }
})

export let { increase } = testState2.actions;
export default testState2;
